	1. 查找span标签的值
&lt;/p&gt;
&lt;pre class=&quot;brush:js;&quot;&gt;	&amp;nbsp; &amp;nbsp; var value = $(&quot;p&quot;).find(&quot;span&quot;).text().
&lt;/pre&gt;
&lt;p&gt;
	2.关于append,prepend,after,before标签的用法
&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp; &amp;nbsp;append() - 在被选元素的结尾插入内容（内容的结尾，比如说有个标签，则是在这个标签结尾之前添加东西）&amp;nbsp;
&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp; &amp;nbsp;prepend() - 在被选元素的开头插入内容（内容的开始，比如说有个p标签，则是在这个标签开始之后添加东西）&amp;nbsp; 
&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp; &amp;nbsp;after() - 在被选元素之后插入内容（元素的结尾，比如说有个p标签，则是在这个标签结束之后添加东西）&amp;nbsp;
&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp; &amp;nbsp;before() - 在被选元素之前插入内容（内容的开始，比如说有个p标签，则是在p这个标签开始之前添加东西）
&lt;/p&gt;
&lt;p&gt;
	3.closest
&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp; &amp;nbsp; this.closest('.ul'):往上离这个标签最近的元素。
&lt;/p&gt;','1516147200','1518160262');
