当&lt;/span&gt;&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;太白&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;有&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;鸟道&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_9&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;可以&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;横绝&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;峨眉巅&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_10&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;地崩山摧壮士死&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_11&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;然后天梯&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;石栈&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;相钩连。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_12&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;上有&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;六龙回日&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;之&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;高标&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_13&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;下有&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;冲波&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;逆折&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;之&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;回川&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_14&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;黄鹤&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;之飞&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;尚&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;不&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;得&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;过，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_15&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;猿猱&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;欲度愁攀援。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_16&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;青泥&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;何&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;盘盘&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_17&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;百步九折&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;萦&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;岩峦&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_18&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;扪参&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;历&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;井&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;仰&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;胁息&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_1_19&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;以手抚&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;膺&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;坐&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;长叹。&lt;/span&gt;&lt;/span&gt; 
&lt;/p&gt;
&lt;p class=&quot;poem-detail-main-text&quot; id=&quot;body_p&quot; style=&quot;font-size:15px;color:#333333;font-family:Arial, sans-serif;background-color:#FFFFFF;&quot;&gt;
	&lt;span id=&quot;body_2_0&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp; &amp;nbsp;问&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;君&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;西游何时还？&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_1&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;畏途&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;巉岩&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;不可攀。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_2&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;但见&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;悲鸟&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;号古木&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_3&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;雄飞雌&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;从&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;绕林间。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_4&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;又闻&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;子规&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;啼夜月，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_5&quot; style=&quot;font-size:24px;&quot;&gt;愁空山。&lt;/span&gt;&lt;span id=&quot;body_2_6&quot; style=&quot;font-size:24px;&quot;&gt;蜀道之难，&lt;/span&gt;&lt;span id=&quot;body_2_7&quot; style=&quot;font-size:24px;&quot;&gt;难于上青天，&lt;/span&gt;&lt;span id=&quot;body_2_8&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;使人听此&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;凋朱颜&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;！&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_9&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;连峰&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;去&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;天不&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;盈&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;尺，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_10&quot; style=&quot;font-size:24px;&quot;&gt;枯松倒挂倚绝壁。&lt;/span&gt;&lt;span id=&quot;body_2_11&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;飞湍&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;瀑流争&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;喧豗&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_12&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;砯崖&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;转石万&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;壑&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;雷。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_2_13&quot; style=&quot;font-size:24px;&quot;&gt;其险也如此，&lt;/span&gt;&lt;span id=&quot;body_2_14&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;嗟&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;尔远道之人&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;胡为&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;乎来哉！&lt;/span&gt;&lt;/span&gt; 
&lt;/p&gt;
&lt;p class=&quot;poem-detail-main-text&quot; id=&quot;body_p&quot; style=&quot;font-size:15px;color:#333333;font-family:Arial, sans-serif;background-color:#FFFFFF;&quot;&gt;
	&lt;span id=&quot;body_3_0&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 剑阁&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;峥嵘而崔嵬，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_3_1&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;一夫&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;当关&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_3_2&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;万夫&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;莫开&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;。&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_3_3&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;所守&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;或匪亲&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_3_4&quot; style=&quot;font-size:24px;&quot;&gt;化为狼与豺。&lt;/span&gt;&lt;span id=&quot;body_3_5&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;朝&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;避猛虎，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_3_6&quot; style=&quot;font-size:24px;&quot;&gt;夕避长蛇；&lt;/span&gt;&lt;span id=&quot;body_3_7&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;磨牙&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;吮&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;血，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_3_8&quot; style=&quot;font-size:24px;&quot;&gt;杀人如麻。&lt;/span&gt;&lt;span id=&quot;body_3_9&quot;&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;锦城&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;虽云乐，&lt;/span&gt;&lt;/span&gt;&lt;span id=&quot;body_3_10&quot; style=&quot;font-size:24px;&quot;&gt;不如早还家。&lt;/span&gt;&lt;span id=&quot;body_3_11&quot; style=&quot;font-size:24px;&quot;&gt;蜀道之难，&lt;/span&gt;&lt;span id=&quot;body_3_12&quot; style=&quot;font-size:24px;&quot;&gt;难于上青天，&lt;/span&gt;&lt;span id=&quot;body_3_13&quot;&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;侧身西望长&lt;/span&gt;&lt;span class=&quot;body-zhushi-span&quot; style=&quot;font-size:24px;&quot;&gt;咨嗟&lt;/span&gt;&lt;span style=&quot;font-size:24px;&quot;&gt;！&lt;/span&gt;&lt;/span&gt; 
&lt;/p&gt;','1519654165','1519654224');
	在使用thinkphp上传文件时，最好上传到public文件夹下面，因为thinkphp框架会禁止对文件操作。
&lt;/p&gt;
&lt;p&gt;
	上传文件成功后，返回的文件信息需要加上uploads文件夹的父文件夹。如：
&lt;/p&gt;
&lt;p&gt;
	上传文件地址：uploads。实际上传地址为: /thinkphp5/public/uploads
&lt;/p&gt;
&lt;p&gt;
	返回文件信息需要添加: /thinkphp5/public
&lt;/p&gt;
&lt;pre class=&quot;brush:js;&quot;&gt;	
$file = request()-&amp;gt;file('imgFile');//获取信息
if ($file){
    $info = $file-&amp;gt;validate()-&amp;gt;move($this-&amp;gt;file_move_path);//存储到指定位置
    $file_path = $this-&amp;gt;file_back_path.DS.$info-&amp;gt;getSaveName();//获取返回信息
    $file_path = '/Tp5-TuFanInc-Admin-master/public'.$up_config['image_url']
        .str_replace('\\', '/', $file_path);//完整路径
    echo json_encode(['error' =&amp;gt; 0, 'url' =&amp;gt; $file_path]);//JSON返回客户端
&lt;/pre&gt;','1519722871','1519723637');
